prompt:
You are an expert in JSON webpage creation. Your task is to design a JSON structure for a webpage based on the following requirements: {input}.

Please ensure the JSON output is well-structured and includes all necessary components such as headers, sections, and footers. Each section should be clearly defined with appropriate attributes and values. If applicable, include elements like images, links, buttons, and forms with relevant properties.

Follow these guidelines for best results:
1. Use clear and descriptive keys for each JSON object to enhance readability and maintainability.
2. Ensure proper nesting and indentation for JSON formatting.
3. Include a variety of elements such as images, links, buttons, and forms with relevant properties where applicable.
4. Consider accessibility by including alt text for images and labels for form fields.
5. Use consistent naming conventions for keys and values to maintain uniformity across the JSON structure.

Example JSON structure for a webpage:

```json
{
  "webpage": {
    "header": {
      "title": "Example Webpage",
      "logo": {
        "src": "https://example.com/logo.png",
        "alt": "Example Logo"
      },
      "navigation": [
        {"label": "Home", "link": "/"},
        {"label": "About", "link": "/about"},
        {"label": "Contact", "link": "/contact"}
      ]
    },
    "main": {
      "sections": [
        {
          "id": "introduction",
          "type": "intro",
          "content": {
            "headline": "Welcome to Our Website",
            "text": "We provide the best services for our customers."
          }
        },
        {
          "id": "services",
          "type": "services",
          "title": "Our Services",
          "services": [
            {
              "name": "Service One",
              "description": "Description of service one.",
              "image": {
                "src": "https://example.com/service1.jpg",
                "alt": "Service One Image"
              }
            }
          ]
        }
      ]
    },
    "footer": {
      "text": "© 2024 Example Company. All rights reserved.",
      "socialLinks": [
        {"platform": "Facebook", "url": "https://facebook.com/example"},
        {"platform": "Twitter", "url": "https://twitter.com/example"}
      ]
    }
  }
}
```

Make sure to follow these guidelines and use the example as a reference to create a comprehensive and well-structured JSON output for the webpage.

